import pytest
from rest_framework.test import APIClient
from rest_framework.status import HTTP_200_OK, HTTP_204_NO_CONTENT
from django.urls import reverse
from users.models import UserAccount, UserProfile
from users.models import UserAccountFilePage
from django.db.models import Q

@pytest.mark.django_db
def test_report_info_api():
    user = UserAccount.objects.create_user(email="testuser@gmail.com", password="testpassword")
    user_profile = UserProfile.objects.create(user=user)
    user_file_page = UserAccountFilePage.objects.select_related("user__user").filter(Q(user=user_profile) & Q(id=user_profile.id))
    url = reverse("report-info", args=[user_profile.id])
    client = APIClient()
    client.force_authenticate(user=user)
    response = client.get(url)

    if user_file_page:
        expected_data = {
            'education': {'text': 'Education', 'score': user_file_page.user.education_score, 'color': user_file_page.user.education_color, 'result': 'limited'},
            'language': {'text': 'Language skills', 'score': user_file_page.user.language_score, 'color': user_file_page.user.language_color, 'result': 'limited'},
            'special': {'text': 'Special talent', 'score': user_file_page.user.special_skills_score, 'color': user_file_page.user.special_skills_color, 'result': 'limited'},
            'sport': {'text': 'Sport skills', 'score': user_file_page.user.sport_score, 'color': user_file_page.user.sport_color, 'result': 'limited'},
            'work': {'text': 'Work experience', 'score': user_file_page.user.work_experiance_score, 'color': user_file_page.user.work_experiance_color, 'result': 'limited'},
            'program': {'text': 'Program skills', 'score': user_file_page.user.program_score, 'color': user_file_page.user.program_color, 'result': 'limited'}
        }
        expected_response = {
            "data": expected_data,
            "report_key": user_file_page.user.free_report_file_key
        }
        assert response.status_code == HTTP_200_OK
        assert response.data == expected_response
    else:
        assert response.status_code == HTTP_204_NO_CONTENT

@pytest.mark.django_db
def test_skill_info_creation():
    skill_info = SkillInfo(
        text="Education",
        result="limited",
        education_score=75.2,
        language_score=None,
        special_skills_score=None,
        sport_score=None,
        work_experiance_score=None,
        program_score=None,
    )
    assert skill_info["text"] == "Education"
    assert skill_info["result"] == "limited"
    assert skill_info["education_score"] == 75.2
    assert skill_info["language_score"] is None
    assert skill_info["special_skills_score"] is None
    assert skill_info["sport_score"] is None
    assert skill_info["work_experiance_score"] is None
    assert skill_info["program_score"] is None

